{"cells":[{"source":"<a href=\"https://www.kaggle.com/agatabieganska/cyclistic-case-study-2021?scriptVersionId=87146870\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"f084aaf4","metadata":{"papermill":{"duration":0.056184,"end_time":"2022-02-06T19:22:59.257854","exception":false,"start_time":"2022-02-06T19:22:59.20167","status":"completed"},"tags":[]},"source":["### Introduction\n","\n","Below is my take on Coursera’s Google Data Analytics Capstone: Complete a Case Study course. The main task is to analyze data for a fictional company, Cyclistic, and share my insights on their business questions. This study will follow six steps of the data analysis process: ask, prepare, process, analyze, share, and act.\n","\n","### Scenario\n","\n","Cyclistic is a bike sharing company that offers 5,824 bicycles in 692 stations across Chicago. Cyclistic offers single-ride passes, full-day passes, and annual memberships. Until now, their marketing approach focused on bringing new customers, but latest financial analysis concluded that members with annual passes are much more profitable than others. Their plan is to design a new marketing strategy in order to convert casual riders into annual members."]},{"cell_type":"markdown","id":"ebfb01d5","metadata":{"papermill":{"duration":0.048758,"end_time":"2022-02-06T19:22:59.35633","exception":false,"start_time":"2022-02-06T19:22:59.307572","status":"completed"},"tags":[]},"source":["### Step One: Ask\n","\n","##### *Identify the business task:*\n","\n","Help Cyclistic company to convert casual bike users into annual members by analyzing historical data to identify trends and patterns in bike usage, as well as differences between casual riders and Cyclistc members.\n","\n","##### *Key stakeholders:*\n","\n","The key stakeholders are: Lily Moreno, director of marketing and manager, Cyclistic marketing analytics team and Cyclistic executive team.\n","\n","##### *Main Question:*\n","\n","How do annual members and casual bikers use Cyclistic bikes differently?"]},{"cell_type":"markdown","id":"bb64943d","metadata":{"papermill":{"duration":0.049311,"end_time":"2022-02-06T19:22:59.454945","exception":false,"start_time":"2022-02-06T19:22:59.405634","status":"completed"},"tags":[]},"source":["### Step Two: Prepare\n","\n","##### *Data source used and credibility of the data:*\n","\n","The data has been downloaded from <a href=\"https://divvy-tripdata.s3.amazonaws.com/index.html\">this source</a> and has been made available by Motivate International Inc. under <a href=\"https://ride.divvybikes.com/data-license-agreement\">this license</a>.\n","\n","Data-privacy issues prohibit from using riders’ personally identifiable information. It won’t be possible to determine if casual riders live in the Cyclistic service area or if they have purchased multiple single passes.\n","\n","##### *Sort and filter the data:*\n","\n","Previous years has been compiled into quarters in CSV files, but data from last year (2021) is sorted into months. After downloading the zip files, I decide to open and inspect first file containing the data from January 2021 in Excel. I covert values from text to columns using Power Query. The table has 13 columns and 96835 rows.  \n","\n","The column headers are: ride_id, rideable_type, started_at, ended_at, start_station_name, start_station_id, end_station_name, end_station_id, start_lat, start_lng, end_lat, end_lng, member_casual. \n","\n","Due to volume and size of the files, I decide to use RStudio for further data cleaning and analysis."]},{"cell_type":"code","execution_count":1,"id":"a9cdde67","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-02-06T19:22:59.562701Z","iopub.status.busy":"2022-02-06T19:22:59.559466Z","iopub.status.idle":"2022-02-06T19:24:01.187993Z","sh