#### *Notes:*\n","Members took approximately 10% more trips than casual users.\n","Classic bikes were the most popular - out of all rides, around 58% were made on a classic bike.\n","Although annual members made more trips overall, casual riders took over Cyclistic bikes on the weekend - 18.5% of all trips were made by single-pass customers on Saturday and Sunday.\n","On the other hand, Cyclistic members took the most rides on Wednesday and Tuesday. \n","This may point to a conclusion that annual members take the most trips on business days, making short trips to work or school, and casual users like to take Cyclistic bikes on longer, more leisurely rides on the weekend."]},{"cell_type":"code","execution_count":13,"id":"0c64f736","metadata":{"execution":{"iopub.execute_input":"2022-02-06T19:25:22.260208Z","iopub.status.busy":"2022-02-06T19:25:22.258645Z","iopub.status.idle":"2022-02-06T19:25:26.260887Z","shell.execute_reply":"2022-02-06T19:25:26.259061Z"},"papermill":{"duration":4.111891,"end_time":"2022-02-06T19:25:26.261028","exception":false,"start_time":"2022-02-06T19:25:22.149137","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A grouped_df: 5 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>member_casual</th><th scope=col>start_station_name</th><th scope=col>n</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>member</td><td><span style=white-space:pre-wrap>Clark St &amp; Elm St       </span></td><td>24378</td></tr>\n","\t<tr><td>member</td><td><span style=white-space:pre-wrap>Wells St &amp; Concord Ln   </span></td><td>23405</td></tr>\n","\t<tr><td>member</td><td>Kingsbury St &amp; Kinzie St</td><td>23244</td></tr>\n","\t<tr><td>member</td><td><span style=white-space:pre-wrap>Wells St &amp; Elm St       </span></td><td>20742</td></tr>\n","\t<tr><td>member</td><td><span style=white-space:pre-wrap>D