" | month == \"May\" | month == \"June\") %>% \n","  summarise(count = n()) %>% \n","  ggplot(aes(x = factor(weekday, c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\")), y = count, fill = member_casual)) +\n","  geom_col(position = \"dodge\", colour = \"black\") +\n","  facet_wrap(~ month) +\n","  theme(axis.text.x=element_text(size=7, angle=50, hjust=0.4, vjust=0.5)) +\n","  scale_fill_manual(values=c(\"#E98B56\", \"#56B4E9\")) +\n","  labs(y = \"Number of rides\", x = \"Day of the week\", title = \"Total number of trips by day of the week in each month\") \n","\n","# Total number of trips per week day in each month (Q3)\n","\n","tripdata %>% \n","  group_by(weekday, member_casual, month) %>% \n","  filter(month == \"July\" | month == \"August\" | month == \"September\") %>% \n","  summarise(count = n()) %>% \n","  ggplot(aes(x = factor(weekday, c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\")), y = count, fill = member_casual)) +\n","  geom_col(position = \"dodge\", colour = \"black\") +\n","  facet_wrap(~ month) +\n","  theme(axis.text.x=element_text(size=7, angle=50, hjust=0.4, vjust=0.5)) +\n","  scale_fill_manual(values=c(\"#E98B56\", \"#56B4E9\")) +\n","  labs(y = \"Number of rides\", x = \"Day of the week\", title = \"Total number of trips by day of the week in each month\") \n","\n","# Total number of trips per week day in each month (Q4)\n","\n","tripdata %>% \n","  group_by(weekday, member_casual, month) %>% \n","  filter(month == \"October\" | month == \"November\" | month == \"December\") %>% \n","  summarise(count = n()) %>% \n","  ggplot(aes(x = factor(weekday, c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\")), y = count, fill = member_casual)) +\n","  geom_col(position = \"dodge\", colour = \"black\") +\n","  facet_wrap(~ month) +\n","  theme(axis.text.x=element_text(size=7, angle=50, hjust=0.4, vjust=0.5)) +\n","  scale_fill_manual(values=c(\"#E98B56\", \"#56B4E9\")) +\n","  labs(y = \"Number of rides\", x = \"Day of the week\", title = \"Total number of trips by day of the week in each month\") "]},{"cell_type":"markdown","id":"acf0994a","metadata":{"papermill":{"duration":0.128103,"end_time":"2022-02-06T19:25:38.194438","exception":false,"start_time":"2022-02-06T19:25:38.066335","status":"completed"},"tags":[]},"source":["##### *Notes:*\n","Annual members consistently take more trips than casual riders on every day of the week in the first quarter of the year.\n","Around the month of April, single-pass customers start to make more rides than members on the weekends.\n","This confirms our previous findings, that annual members take more everyday trips to school and work, and casual riders are more likely to use Cyclistic bikes for leisure."]},{"cell_type":"markdown","id":"c9bba0b2","metadata":{"papermill":{"duration":0.128689,"end_time":"2022-02-06T19:25:38.449848","exception":false,"start_time":"2022-02-06T19:25:38.321159","status":"completed"},"tags":[]},"source":["### Step Six: Act\n","##### **Summary of the analysis and my recommendations**\n","\n","##### *Summary:*\n","\n","<ul style=“list-style-type:disc”>\n","    <li>Annual Cyclistic members tend to use bikeshare services for their daily commute, whereas single-pass users predominately take recreational trips on the weekends. </li>\n","    <li>Casual riders take on average two times longer trips than annual members, but members made more trips overall.</li>\n","    <li>The most trips occured in May-October period. Casual riders made the most trips in July and August, while members took the highest number of rides in August and September.</li>\n","</ul>\n","\n","##### *Recommendations:*\n","\n","<ul style=“list-style-type:disc”>\n","    <li>Introduce 6-month/3-month (summer) passes.</li>\n","    <li>Introduce weekend passes (yearly passes that would allow customers to undock bikes only on weekends).</li>\n","    <li>Increase advertising around stations used the most by casual riders and during the busiest, summer and autumn months.</li>\n","    <li>Change advertising strategy to focus on two sides of biking: as leisure activity and everyday commute.</li>\n","    <li>Plan routes around most popular tourist attractions, parks and beaches.</li>\n","    <li>Encourage weekend riders to use Cyclistic bikes every day (advertisements in business districs, cooperating with businesses in order to advertise bikesharing to their employees).</li>\n","</ul>"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":162.989543,"end_time":"2022-02-06T19:25:38.787202","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-02-06T19:22:55.797659","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}